require 'pry'

str1 = 'GAATCCGT'
str2 = ''
str3 = ''
str = str3

base_map = []
n = str.size/4
count = Hash.new{|h, k|h[k]=0}
str.split('').each_with_index do |s, i|
  count[s]+=1
  base_map << count.dup
end
binding.pry
bases_to_be_modified = Hash[count.select{|k, v|v>n}.map{|k, v|v-=n; [k, v]}]

if !bases_to_be_modified.empty?
  start_index, end_index, length_of_smallest_sub = [0, 0, +1.0/0.0]
  while end_index < str.size
    found = bases_to_be_modified.map do |k, v|
      num_of_base = base_map[end_index][k]-base_map[start_index][k]
      num_of_base >= v
    end.all?
    if found
      local = end_index - start_index
      length_of_smallest_sub = local if local < length_of_smallest_sub
      start_index += 1
    else
      end_index += 1
    end
  end
else
  length_of_smallest_sub = 0
end

print length_of_smallest_sub.to_s+"\n"
